VECTOR* GetVehicleModelInfo(int iVehicleType, int iInfoType)
{
	if(iVehicleType < 400 || iVehicleType > 611)
		return NULL;

	VEHICLE_MODEL_INFO* pInfo = &VehicleModelInfos[iVehicleType - 400];
	static VECTOR vecTemp;

	switch(iInfoType) {
		case VEHICLE_MODEL_INFO_SIZE:
			return &pInfo->vecSize;
		case VEHICLE_MODEL_INFO_FRONTSEAT:
			return &pInfo->vecFrontSeat;
		case VEHICLE_MODEL_INFO_REARSEAT:
			return &pInfo->vecRearSeat;
		case VEHICLE_MODEL_INFO_PETROLCAP:
			return &pInfo->vecPetrolCap;
		case VEHICLE_MODEL_INFO_WHEELSFRONT:
			return &pInfo->vecWheelsFront;
		case VEHICLE_MODEL_INFO_WHEELSREAR:
			return &pInfo->vecWheelsRear;
		case VEHICLE_MODEL_INFO_WHEELSMID:
			return &pInfo->vecWheelsMid;
		case VEHICLE_MODEL_INFO_FRONT_BUMPER_Z:
			memset(&vecTemp, 0, sizeof(vecTemp));
			vecTemp.Z = pInfo->fFrontBumperZ;
			return &vecTemp;
		case VEHICLE_MODEL_INFO_REAR_BUMPER_Z:
			memset(&vecTemp, 0, sizeof(vecTemp));
			vecTemp.Z = pInfo->fRearBumperZ;
			return &vecTemp;
	}
	return NULL;
}

